import React from "react";
import { FlatList, View, StyleSheet, Text } from "react-native";
import RequestItem from "../../components/RequestItem";

const data = [
  {
    id: 1,
    name: "Elie Kozah",
    hourly_rate: 50000,
    time: "14/12/2021 5:00pm till 6:00pm",
    status: "Pending",
  },
  {
    id: 2,
    name: "Fatima Medlij",
    hourly_rate: 50000,
    time: "14/12/2021 5:00pm till 6:00pm",
    status: "Accepted",
  },
  {
    id: 3,
    name: "Elie Kozah",
    hourly_rate: 50000,
    time: "14/12/2021 5:00pm till 6:00pm",
    status: "Rejected",
  },
];

const ClientRequests = () => {
  return (
    <View style={styles.container}>
      <Text style={styles.text}>Client Requests</Text>
      <FlatList
        data={data}
        onPress={() => console.log("request", item)}
        keyExtractor={(request) => request.id.toString()}
        renderItem={({ item }) => <RequestItem 
        provider_name={item.name}
        provider_rate={item.hourly_rate} 
        date_time={item.time}

        />}
      />
    </View>
  );
};
const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
  text: {
    fontSize: 20,
    fontWeight: "bold",
  },
});
export default ClientRequests;
